import React from 'react';
import PropTypes from 'prop-types'

function AppLayout(props) {
    return (
        <div>
            <div>공통메뉴</div>
            {props.children}
        </div>
    );
};

AppLayout.propTypes = {
    children: PropTypes.node.isRequired,
};

export default AppLayout;
